            <div className="p-8">
              {/* 헤더 */}
              <div className="text-center mb-8 border-b-2 border-gray-300 pb-6">
                <div className="flex justify-center mb-4">
                  <img
                    src="/icons8-certificate-94.png"
                    width={80}
                    height={80}
                    alt="certificate"
                    className="opacity-80"
                  />
                </div>
                <h2 className="text-3xl font-bold text-gray-800 mb-2">데이터 등록증</h2>
                <p className="text-gray-600">Data Registration Certificate</p>
              </div>

              {/* 등록증 정보 */}
              <div className="space-y-6">
                <div className="bg-gray-50 p-6 rounded-lg">
                  <h3 className="text-xl font-bold text-gray-800 mb-4 border-b border-gray-300 pb-2">
                    기본 정보
                  </h3>
                  <div className="grid grid-cols-2 gap-4">
                    <div>
                      <p className="text-sm text-gray-600 mb-1">데이터명</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.marketDataName || detailData.marketDatatName || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">등록번호</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.marketVcId || detailData.marketNo || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매자</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.saleUserName || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">등록일</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.regDttm || '-'}
                      </p>
                    </div>
                  </div>
                </div>

                <div className="bg-gray-50 p-6 rounded-lg">
                  <h3 className="text-xl font-bold text-gray-800 mb-4 border-b border-gray-300 pb-2">
                    상세 정보
                  </h3>
                  <div className="grid grid-cols-2 gap-4">
                    <div>
                      <p className="text-sm text-gray-600 mb-1">데이터 설명</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketDataDesc || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">상품유형</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketProductType || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">언어</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketLanguage || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">키워드</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketKeyword || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">주제</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketSubject || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">발행기관</p>
                      <p className="text-base text-gray-800">
                        {detailData.marketIssuer || '-'}
                      </p>
                    </div>
                    {detailData.marketDoi && (
                      <div>
                        <p className="text-sm text-gray-600 mb-1">DOI 번호</p>
                        <p className="text-base text-gray-800">
                          {detailData.marketDoi}
                        </p>
                      </div>
                    )}
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매 가격</p>
                      <p className="text-base font-semibold text-blue-600">
                        {detailData.price && detailData.price > 0 
                          ? `${Number(detailData.price).toLocaleString('ko-KR', { maximumFractionDigits: 6 })} ETH` 
                          : '무료'}
                      </p>
                    </div>
                  </div>
                </div>

                <div className="bg-gray-50 p-6 rounded-lg">
                  <h3 className="text-xl font-bold text-gray-800 mb-4 border-b border-gray-300 pb-2">
                    판매 정보
                  </h3>
                  <div className="grid grid-cols-2 gap-4">
                    <div>
                      <p className="text-sm text-gray-600 mb-1">발행 수량</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.issueCnt || 0}개
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매 수량</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.saleCnt || 0}개
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">보유 수량</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.inventoryCnt || 0}개
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매 상태</p>
                      <p className="text-base font-semibold text-gray-800">
                        {detailData.stateDesc || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매 시작일</p>
                      <p className="text-base text-gray-800">
                        {detailData.startDttm || '-'}
                      </p>
                    </div>
                    <div>
                      <p className="text-sm text-gray-600 mb-1">판매 종료일</p>
                      <p className="text-base text-gray-800">
                        {detailData.endDttm || '-'}
                      </p>
                    </div>
                  </div>
                </div>

                {detailData.saleAccount && (
                  <div className="bg-gray-50 p-6 rounded-lg">
                    <h3 className="text-xl font-bold text-gray-800 mb-4 border-b border-gray-300 pb-2">
                      판매자 정보
                    </h3>
                    <div className="grid grid-cols-1 gap-4">
                      <div>
                        <p className="text-sm text-gray-600 mb-1">판매자 지갑 주소</p>
                        <p className="text-base text-gray-800 break-all">
                          {detailData.saleAccount}
                        </p>
                      </div>
                      {detailData.saleAccountUrl && (
                        <div>
                          <p className="text-sm text-gray-600 mb-1">지갑 주소 링크</p>
                          <a 
                            href={detailData.saleAccountUrl} 
                            target="_blank" 
                            rel="noopener noreferrer"
                            className="text-blue-600 hover:text-blue-800 underline break-all"
                          >
                            {detailData.saleAccountUrl}
                          </a>
                        </div>
                      )}
                    </div>
                  </div>
                )}

                {/* 푸터 */}
                <div className="text-center mt-8 pt-6 border-t-2 border-gray-300">
                  <p className="text-sm text-gray-500">
                    본 등록증은 데이터 마켓에 등록된 데이터의 정보를 증명합니다.
                  </p>
                  <p className="text-xs text-gray-400 mt-2">
                    발급일: {new Date().toLocaleDateString('ko-KR')}
                  </p>
                </div>
              </div>

              {/* 인쇄 버튼 */}
              <div className="flex justify-center gap-4 mt-8">
                <button
                  onClick={() => window.print()}
                  className="px-6 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
                >
                  인쇄하기
                </button>
                <button
                  onClick={() => setShowCertificate(false)}
                  className="px-6 py-2 border border-gray-300 rounded text-gray-700 hover:bg-gray-50"
                >
                  닫기
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </main>
  );
};

export default MarketSellDetailContainer;
